import React, { Component } from 'react';
import '../App.css';
import axios from 'axios';
import DeleteDoctor from './deleteDoctor';

class addDoctor extends Component {

  constructor(props) {
    super(props);

    this.onChangeName = this.onChangeName.bind(this);
    this.onChangeSpeciality = this.onChangeSpeciality.bind(this);
    this.onChangeTimingFrom = this.onChangeTimingFrom.bind(this);
    this.onChangeTimingTo = this.onChangeTimingTo.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
      id : 0, 
      name: '',
      speciality: '',
      timing: '',
      slot:[],
      from:'',
      to:'',
      date: new Date(),
    }
  }

  //   componentDidMount() {
  //     axios.get('http://localhost:5000/users/')
  //       .then(response => {
  //         if (response.data.length > 0) {
  //           this.setState({
  //             users: response.data.map(user => user.username),
  //             username: response.data[0].username
  //           })
  //         }
  //       })
  //       .catch((error) => {
  //         console.log(error);
  //       })

  //   }

  onChangeName(e) {
    this.setState({
      name: e.target.value
    })
  }

  onChangeSpeciality(e) {
    this.setState({
      speciality: e.target.value
    })
  }

  onChangeTimingFrom(e) {
    this.setState({
      from: e.target.value
    })
  }
  onChangeTimingTo(e) {
    this.setState({
      to: e.target.value
    })
  }

  onChangeDate(date) {
    this.setState({
      date: date
    })
  }

  
 onSubmit=(e)=> {
    e.preventDefault();
    var y = this.state.to - this.state.from;
    var z =this.state.from;
    var arr=[];
    const  start=["01","16","31","46"];
    const  end=["15","30","45","00"];

    for(let i=0; i<y; i++){
      const hour=parseInt(z)+i;
      for(let j=0;j<3;j++)
      
